import React, { useState } from "react";
import TextField from '@material-ui/core/TextField';
import AddNote from "./AddNote";
// import AddIcon from '@material-ui/icons/Add';

const CreateNoteComp = () => {

    const [note, setNote] = useState({
        title: "",
        content: ""
    });


    const textEdit = (e)=>{

        const {name, value} = e.target;

        setNote((oldItems) =>{
            return {
                ...oldItems,
                [name]: value
            };
        });
    }

    // const clearInput = (e)=>{
    //     e.target.value = "";
    // }

    const addEvent = ()=>{
        <AddNote />
    }




    return (
        <div className="d-flex justify-content-center">
            <div className="row col-md-3 m-4 noteBox d-flex justify-content-center">
                <form>
                    <TextField 
                    label="Title"
                    value={note.title}
                    onChange={textEdit}
                    name="title"      
                     />
                    <br />
                    <br />
                    <TextField
                        id="outlined-multiline-static"
                        label="Note"
                        multiline
                        rows={4}
                        placeholder="wrtie a Note"
                        variant="outlined"
                        value={note.content}
                        onChange={textEdit}
                        name="content"
                    />
                    <br />
                    <br />
                    <span>
                        <button className="btn btn-outline-primary float-left"> Clear </button>
                        <button className="btn btn-outline-primary float-right" onClick= {addEvent}> Add </button>
                    </span>
                </form>
            </div>
        </div>
    );
}

export default CreateNoteComp;
